import React, { useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  useEffect(() => {
    fetch("https://api.ipify.org?format=json&callback=?")
      .then((response) => response.json())
      .then((data) => console.log(data, "my ip"));
  });
  useEffect(() => {
    fetch(
      "https://geo.ipify.org/api/v2/country?apiKey=at_3qmlDaay8nIBIyxf7Lia1IPzdJ3X3&ipAddress=8.8.8.8"
    )
      .then((response) => response.json())
      .then((data) => console.log(data));
  }, []);
  return (
    <div className="App">
      <header className="App-header"></header>
    </div>
  );
}

export default App;
